import styled from "styled-components";

export const GalleryContainer = styled.div`
  height: 800px;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  /* background: #010606; */
`;

export const GalleryCarousel = styled.div`
  max-width: 1000px;
  margin: 0 auto;
`;

export const GalleryCard = styled.div`
  border-radius: 10px;
  max-height: 340px;
  padding: 30px;
`;

export const GalleryH1 = styled.h1`
  font-size: 2.5rem;
  color: #000;
  /* margin-bottom: 64px; */
`;
